  \"2015-01-22T15:57:42.108478\",\n\t\"name\": \"home-grantee-areas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The HOME Investment Partnership Program
  (HOME) is authorized under Title II of the Cranston-Gonzalez National Affordable
  Housing Act. HOME provides formula grants to States and localities that communities
  use u0096 often in partnership with local nonprofit groups u0096 to fund a wide
  range of activities that build, buy, and/or rehabilitate affordable housing for
  rent or homeownership or provide direct rental assistance to low-income people.
  HOME is the largest Federal block grant to State and local governments designed
  exclusively to create affordable housing for low-income households. Each year it
  allocates approximately $2 billion among the States and hundreds of localities nationwide.\",\n\t\"license_title\":
